import React from "react";
import { MenuList } from "../helpers/articlelist";
import Log from "../assets/image9.jpg";
import MenuItem from "../components/article";
import "../styles/book.css";

function Ab() {
  return (
    <div className="about" style={{ backgroundImage: `url(${Log})` }}>
      <div
        className="aboutTop"
      ></div>
      <div className="aboutBottom">
        <h1>ARTICLES</h1>
        <div className="menu">
          <div className="menuList">
            {MenuList.map((menuItem, key) => {
              return (
                <a href={menuItem.link} key={key}>
                  {/* Wrap the content with an anchor tag */}
                  <div className="menuItem">
                    <img src={menuItem.image} alt={`Image ${key}`} />
                    <div className="name">{menuItem.name}</div>
                    <div className="author">{menuItem.author}</div>
                  </div>
                </a>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Ab;
